import React from 'react'
import Items from './logs-items'
import './logs.css'

export default function Logs() {
  const logsData = [
    {
     date:new Date(2022,11,5,13,10),
     desc:"哈利波特",
     time:300
    },
    {
     date:new Date(2023,1,5,23,15),
     desc:"漫步華爾街",
     time:300
    },
    {},
    {}
  ]
  return (
    <div className='logs'>
      <Items date={new Date(2022,11,5,13,10)}  desc={"Node.js"} time={'120min'}
      />

      <Items date={new Date(2022,11,8,20,0)}  desc={"React.js"} time={'100min'}
            />
    </div>
    
  )
}
